// login

import Axios from "axios";

export const acLoginRq = (data) => {
  return (dispatch) => {
    Axios.post("https://dev.miagi-so.net/api/v1/login", data)
      .then((res) => console.log(res.data))
      .catch((err) => console.log(err));
  };
};
